import "./Home.css";
import { fetchDashboardData } from "../TanStack/dashboard";
import { useQuery } from "@tanstack/react-query";

function UserHome() {
  const {
    data,
    isLoading,
    isError,
    error,
    isFetching,
  } = useQuery({
    queryKey: ["user-dashboard"],
    queryFn: fetchDashboardData,
    staleTime: 60 * 1000,
  });

  if (isLoading) {
    return <p style={{ padding: "20px" }}>Loading dashboard...</p>;
  }

  if (isError) {
    return (
      <p style={{ padding: "20px", color: "red" }}>
        Failed to load dashboard: {error.message}
      </p>
    );
  }

  return (
    <div className="home">
      <p className="home-subtitle">
        Track your fitness progress & membership
        {isFetching && <span style={{ marginLeft: 10 }}>üîÑ Refreshing‚Ä¶</span>}
      </p>

      <div className="stats">
        <div className="card">
          <h3>Membership Plan</h3>
          <p>{data.plan}</p>
          <span className="card-note">Active</span>
        </div>

        <div className="card">
          <h3>Sessions Attended</h3>
          <p>{data.sessionsAttended}</p>
          <span className="card-note">This month</span>
        </div>

        <div className="card">
          <h3>Remaining Days</h3>
          <p>{data.remainingDays}</p>
          <span className="card-note">In current plan</span>
        </div>

        <div className="card">
          <h3>Trainer</h3>
          <p>{data.trainerName}</p>
          <span className="card-note">Assigned coach</span>
        </div>
      </div>

      <div className="section">
        <h2>Recent Activity</h2>
        <ul className="activity-list">
          <li>üèãÔ∏è Last workout: {data.lastWorkout}</li>
          <li>üî• Calories burned: {data.caloriesBurned}</li>
          <li>üìÖ Next session: {data.nextSession}</li>
          <li>üí≥ Payment status: {data.paymentStatus}</li>
        </ul>
      </div>
    </div>
  );
}

export default UserHome;
